import React from 'react'
import Item from './Item'
import Todo from '../models/todo'

const Todos:React.FC<{items:Todo[],removeTodo:(id:string)=>void, children?:string}>=(props)=> {
    console.log(props)
  return (
		<div>
			<h1>Todos Page:</h1>
			<ul>
				{props.items.map((item: Todo) => (
					<Item key={item.id} item={item} removeTodo ={props.removeTodo}/>
				))}
			</ul>
		</div>
	)
}

export default Todos

